import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
  },
  getters: {
  },
  mutations: {
    logout() {
      localStorage.removeItem("user");
      delToken();
      this.$router.push("/login");
    }
